// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.6.9;

pragma experimental ABIEncoderV2;

contract TaxiRegistry {
    address public owner;

    // Structure to represent a taxi driver
    struct TaxiDriver {
        string name;
        address driverAddress;
    }

    // Mapping to store taxi drivers
    mapping(address => TaxiDriver) public taxiDrivers;

    // Event to log when a new taxi driver is registered
    event TaxiDriverRegistered(address indexed driverAddress, string name);

    // Constructor with parameters
    constructor() public {
        owner = msg.sender;
        taxiDrivers[owner] = TaxiDriver({
            name: "Owner",
            driverAddress: owner
        });
        emit TaxiDriverRegistered(owner, "Owner");
    }

    // Modifier to allow only the contract owner to execute certain functions
    modifier onlyOwner() {
        require(msg.sender == owner, "Not the contract owner");
        _;
    }

    // Function to register a new taxi driver
    function registerTaxiDriver(string memory _name) external {
        require(msg.sender != owner, "Owner cannot register as a taxi driver");
        require(bytes(_name).length > 0, "Name cannot be empty");
        require(taxiDrivers[msg.sender].driverAddress == address(0), "Driver already registered");

        require(isValidTaxiDriver(msg.sender), "Not a valid taxi driver");

        taxiDrivers[msg.sender] = TaxiDriver({
            name: _name,
            driverAddress: msg.sender
        });

        emit TaxiDriverRegistered(msg.sender, _name);
    }

    // Internal function to check if an address is a valid taxi driver (1 to 9)
    function isValidTaxiDriver(address _address) internal pure returns (bool) {
        return uint8(_address) >= 1 && uint8(_address) <= 9;
    }

    // Function to get the list of registered taxi drivers
    function getRegisteredDrivers() external view returns (address[] memory driverAddresses, string[] memory driverNames) {
        uint256 driverCount = 0;

        // Count the number of registered drivers
        for (uint256 i = 1; i <= 9; i++) {
            if (taxiDrivers[address(i)].driverAddress != address(0)) {
                driverCount++;
            }
        }

        // Initialize arrays for driver addresses and names
        driverAddresses = new address[](driverCount);
        driverNames = new string[](driverCount);

        // Populate arrays with driver addresses and names
        uint256 index = 0;
        for (uint256 i = 1; i <= 9; i++) {
            if (taxiDrivers[address(i)].driverAddress != address(0)) {
                driverAddresses[index] = taxiDrivers[address(i)].driverAddress;
                driverNames[index] = taxiDrivers[address(i)].name;
                index++;
            }
        }

        return (driverAddresses, driverNames);
    }
}
